import { useState, useEffect } from "react";
import { useDispatch, useSelector } from 'react-redux';
import { getReviews } from "../../action/restaurant";

function Review() {
    const reviews = useSelector(state=>state.restaurant.reviews);
    const dispatch = useDispatch();
    const rid = "res51312ab1b4";
    const RATING = [
        "★☆☆☆☆",
        "★★☆☆☆",
        "★★★☆☆",
        "★★★★☆",
        "★★★★★"
    ];

    useEffect(()=>{
        async function getreviews(){
            const action  = await getReviews(rid)
            dispatch(action);
        }
        getreviews();
    }, [])

    return ( 
        <div>
            <nav className='nav-header'>
                <i class="fas fa-list"></i>
                <i class="fa-solid fa-user"></i>
            </nav>
            <nav className='nav-middle'>
            <div className="view-link">
                    <p className='top'>Reviews</p>
                    <p><a href="/restaurant">Home</a></p>
                    <i class="fas fa-chevron-right"></i>
                    <p>Reviews</p>
                </div>
                <div className="add-review">
                    
                </div>
            </nav>
            <div className="card table-responsive">
                <table id="result_list" class="table table-striped">
                    <thead>
                        <tr>
                            <th class="sorting" tabIndex="0" rowSpan="1" colSpan="1">
                                <div class="text">
                                    <a href="#">User</a>
                                </div>
                            </th>
                            <th class="sorting" tabIndex="0" rowSpan="1" colSpan="1">
                                <div class="text">
                                    <a href="#">Restaurant</a>
                                </div>
                            </th>
                            <th class="sorting" tabIndex="0" rowSpan="1" colSpan="1">
                                <div class="text">
                                    <a href="#">Review</a>
                                </div>
                            </th>
                            <th class="sorting" tabIndex="0" rowSpan="1" colSpan="1">
                                <div class="text">
                                    <a href="#">Rating</a>
                                </div>
                            </th>
                            <th class="sorting" tabIndex="0" rowSpan="1" colSpan="1">
                                <div class="text">
                                    <a href="#">Date</a>
                                </div>
                            </th>
                        </tr>
                    </thead>
                    <tbody>
                        {reviews && reviews.lenght>0? reviews.map((item, index)=>{
                            return (
                                <tr role="row" class="even" key={index}>
                                    {/* <th>{item.user.username}</th>
                                    <td>{item.restaurant.title}</td>
                                    <td>{item.review}</td>
                                    <td>{RATING[item.rating - 1]}</td>
                                    <td>{item.date.subString(0,10)}</td> */}
                                    ok
                                </tr>
                            )
                        })
                        : ""}
                    </tbody>
                </table>
            </div>
        </div>
     );
}

export default Review;
